import React, {Component} from 'react';
import {getMovies} from "../services/fakeMovieService";
import TableHead from "./TableHead"

class Movies extends Component {
    state={
      movies:getMovies()
    };
    render() {
        return (
            <React.Fragment>
                <main className="container">
                <table>
                    <TableHead/>
                </table>
                </main>
            </React.Fragment>
        );
    }
}

export default Movies;
